            // move the pointer to the last non-zero number from right side
            while (right > left && nums[right] == 0) --right;

            if (left >= right) break;

            Swap(ref nums[left], ref nums[right]);
            ++left;
            --right;
        }

        return nums;
    }

    private void Swap<T>(ref T a, ref T b) {
        var temp = a;
        a = b;
        b = temp;
    }
}

