public class Solution {
    public int[] sortColors(int[] A) {
        if (A == null || A.length <= 1) return A;
        int left = -1, right = A.length;
        for (int i = 0; i < A.length; ) {
            if (A[i] == 0) {
                swap(A, ++left, i++);
            } else if (A[i] == 2) {
                swap(A, --right, i);
            } else {
                i++;
            }
        }
        return A;
    }

    private void swap(int[] nums, int a, int b) {
        int tmp = nums[a];
        nums[a] = nums[b];
        nums[b] = tmp;
    }
}

