        if (node == null) return;
        if (val < node.val) swap(node.left, node.right);
        if (node.val == val) {
            node.count++;
        } else {
            node.lessThanLeft = update(node.lessThanLeft, val);
            node.moreThanRight = update(node.moreThanRight, val);
            node.val = val;
            node.count = node.lessThanLeft.count + node.moreThanRight.count + 1;
