public class Solution {
    public int[] fill(int[] arr) {
        if (arr == null || arr.length <= 1) return arr;
        for (int i = arr.length - 1; i > 0 && arr[i]!= 0; --i);
        if (i < 0) return arr;
        int val = arr[i];
        for (int j = i + 1; j < arr.length; ++j) {
            if (arr[j] == 0) continue;
            if (arr[j]!= val) break;
            arr[j] = val + 1;
        }
        for (int k = i - 1; k >= 0; --k) {
            if (arr[k] == 0) continue;
            if (arr[k]!= val) break;
            arr[k] = val + 1;
        }
        return arr;
    }
}

